O Centro de Promoção da Saúde – CEDAPS - é uma organização não-governamental, sem fins lucrativos, criada em 1993, que atua no Rio de Janeiro. A missão do CEDAPS é promover a plena participação de comunidades populares nos processos de desenvolvimento e o aprimoramento de políticas públicas que atuam nestes territórios, contribuindo para a promoção da saúde, a garantia de direitos e a equidade. Entende saúde como um direito humano fundamental que deve existir de maneira eqüitativa para todos os cidadãos. Neste sentido, a Promoção da Saúde, foco do trabalho do CEDAPS, visa à construção de uma sociedade saudável - aquela em que todos os cidadãos têm igual acesso aos recursos que constroem a qualidade de vida: educação, habitação, meio ambiente preservado, emprego e renda, informação, lazer e cultura, saneamento, alimentação, segurança, participação social e serviços de saúde de qualidade. A atuação do CEDAPS se dá nos dois pólos da Promoção da Saúde:

- Fortalece as comunidades para que se tornem gestores sociais ativos, gerando soluções em saúde com recursos próprios. Atua na perspectiva do empoderamento e do trabalho em rede, para que obtenham mais recursos públicos;
- Cria e testa modelos para políticas públicas dedicadas a estes territórios, e contribui para melhorar a qualidade dos serviços existentes.
